// src/components/Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard está sendo exibido!</h2>
      <p>Se você vir este texto, significa que o Dashboard roda sem erros.</p>
    </div>
  );
};

export default Dashboard;
